import React from 'react';

export default function About() {
  return (
    <section id="about">
      <div className="container">
        <div className="row">
          <div className="col">
            <h2><center>About</center></h2>
            <div className="about-content">
              Welcome to our Waste Management System, where we are committed to creating a cleaner and greener future for our planet. Our website offers a comprehensive solution for efficient waste management, ensuring that every step we take contributes to environmental sustainability.
              With our Waste Management System, you can easily schedule waste pickups, track collection services, and effectively manage waste disposal for both residential and commercial purposes. We provide a user-friendly platform that simplifies waste management processes, allowing you to focus on what truly matters - reducing waste and preserving the environment.
            </div>
            <h2></h2>
          </div>
        </div>
      </div>
    </section>
  );
}
